INSERT INTO oneOnOneAnswer(answer, answerOneOnOneIDFK, questionIDFK) VALUES('Sí, cuento con las herramientas y el apoyo necesario, lo que me permite avanzar sin mayores inconvenientes.', '5ef25ab3-10a5-4895-8863-0858f9487274', 'a90c8e13-85d7-4dd8-a728-f68c059315a5');
INSERT INTO oneOnOneAnswer(answer, answerOneOnOneIDFK, questionIDFK) VALUES('Quiero concentrarme en perfeccionar mis habilidades técnicas y cumplir con los plazos establecidos en mis tareas.', 'a64bfd55-4d5e-4a5a-ad87-9a53e58dad99', '96827fe3-c230-4317-80d4-84f7626bc196');
INSERT INTO oneOnOneAnswer(answer, answerOneOnOneIDFK, questionIDFK) VALUES('En general, me siento tranquilo, aunque reconozco que en algunas situaciones se presenta algo de estrés que manejo con calma.', '5f485a0e-dc3d-4f9b-b2ad-5bf6f719ece2', 'a90c8e13-85d7-4dd8-a728-f68c059315a5');
INSERT INTO oneOnOneAnswer(answer, answerOneOnOneIDFK, questionIDFK) VALUES('Vamos a fomentar la comunicación continua y a utilizar herramientas de gestión que nos ayuden a monitorear el progreso.', '18a60a03-ee25-4934-95bc-d8df9a29b113', '899fcdfc-b6cd-403a-8532-a586c9b8d2af');
INSERT INTO oneOnOneAnswer(answer, answerOneOnOneIDFK, questionIDFK) VALUES('En su mayoría la semana fue fluida, aunque surgió una situación que requirió reordenar prioridades, lo cual se solucionó rápidamente.', 'a9d60aee-2733-47b2-b2b3-551e4be48523', '96827fe3-c230-4317-80d4-84f7626bc196');
INSERT INTO oneOnOneAnswer(answer, answerOneOnOneIDFK, questionIDFK) VALUES('En general tengo lo necesario, aunque en algunas áreas podría beneficiarme de recursos adicionales para acelerar ciertos procesos.', '79dedb1a-c758-485a-ba0b-655bd5bb00fd', '899fcdfc-b6cd-403a-8532-a586c9b8d2af');
